import './App.css';
import React, { useEffect, useState } from 'react';
import axios from 'axios';

function App() {
  const [getEmployee, setGetEmployee] = useState({ })

  useEffect(() => {
    axios.get('http://localhost:5000/employees').then(response => {
      console.log("SUCCESS", response)
      setGetEmployee(response)
    }).catch(error => {
      console.log(error)
    })
  }, [])
  return (
    <div className="App">
      <header className="App-header">
        Full Employee List
      </header>
      <div>
        {getEmployee.status === 200 ?
          <h3>{getEmployee.data.employee}</h3>
          :
          <h3>LOADING</h3>
        }
      </div>
    </div>
  );
}

export default App;
